        <script>
          // Initialize and add the map
          let map;

          async function initMap() {
            const position = { lat: -37.18312527345202, lng: 144.24216546866168 }
            const { Map } = await google.maps.importLibrary("maps");

            map = new Map(document.getElementById("map"), {
              mapTypeId: "satellite",
              zoom: 18,
              center: position,
              mapId: "DEMO_MAP_ID",
            });

            // Get user's GPS location
            if (navigator.geolocation) {
              navigator.geolocation.getCurrentPosition(
                (position) => {
                  const userLatLng = {
                    lat: position.coords.latitude,
                    lng: position.coords.longitude,
                  };

                  // Add marker for user's location
                  new google.maps.Marker({
                    position: userLatLng,
                    map: map,
                    title: "Your Location",
                  });

                },
                () => {
                  alert("Error: The Geolocation service failed.");
                }
              );
            } else {
              alert("Error: Your browser doesn't support geolocation.");
            }

            // Draw polygons
            map.data.addGeoJson({type: "FeatureCollection", features: annualPolys.map(function(poly) {return {"type": "Feature", "geometry": poly};})});
            map.data.addGeoJson({type: "FeatureCollection", features: perrenialPolys.map(function(poly) {return {"type": "Feature", "geometry": poly};})});
            map.data.addGeoJson({type: "FeatureCollection", features: infrastructurePolys.map(function(poly) {return {"type": "Feature", "geometry": poly};})});
            map.data.addGeoJson({type: "FeatureCollection", features: waterPolys.map(function(poly) {return {"type": "Feature", "geometry": poly};})});

            //  });
            //  map.data.add({geometry: polygon})
            //  //polygon.setMap(map);
            //});
          }
          initMap();
